set_a = set(map(int, input().split()))n = int(input())is_strict_superset = Truefor _ in range(n):    other_set = set(map(int, input().split()))        if not (other_set.issubset(set_a) and len(other_set) < len(set_a)):        is_strict_superset = False        breakprint(is_strict_superset)